import { DO_LIST_AGENTSUB, LIST_AGENT_SUB_SUCCESS, LIST_AGENT_SUB_FAILED, RESET_LIST_AGENT_SUB_SUCCESS,
DO_LOAD_ALL_AGENTSUB, LOAD_ALL_AGENTSUB_SUCCESS, LOAD_ALL_AGENTSUB_FAILED} from '../../config/constant'


const INITIAL_STATE = {
  fetchingListAgentSub : false,
  fetchingAllListAgentSub: false,
  fetchingListLoading: false,
  dataAgent: [],
  dataSubAgent: [],
  meta: null,
  err: null
}

export default function dataAgenSub(state =  INITIAL_STATE, action){
  let { dataAgent,dataSubAgent } = state;
  switch(action.type) {
    case DO_LIST_AGENTSUB: {
      return {
        ...state,
        fetchingListAgentSub: true,
        fetchingListLoading: true
      }
    }
    case LIST_AGENT_SUB_SUCCESS: {
      dataAgent = action.data
      return {
        ...state,
        fetchingListAgentSub: false,
        fetchingListLoading: false,
        dataAgent,
        meta: action.meta
      }
    }
    case LIST_AGENT_SUB_FAILED: {
      return {
        ...state,
        fetchingListAgentSub: false,
        fetchingListLoading: false
      }
    }
    case RESET_LIST_AGENT_SUB_SUCCESS: {
      return {
        ...state,
        fetchingListAgentSub: false,
        fetchingListLoading: false,
        dataAgent: []
      }
    }
    //DATA SUB AGENT
    case DO_LOAD_ALL_AGENTSUB: {
      return {
        ...state,
        fetchingAllListAgentSub: true
      }
    }
    case LOAD_ALL_AGENTSUB_SUCCESS: {
      dataSubAgent = action.data
      return {
        ...state,
        fetchingAllListAgentSub: false,
        dataSubAgent,
        meta: action.meta
      }
    }
    case LOAD_ALL_AGENTSUB_FAILED: {
      return {
        ...state,
        fetchingAllListAgentSub: false,
      }
    }
    default:
    return state
  }
}
